import React from 'react';

function MyInfo() {
    return (
        <info>
            <h3>Ahmad Al-Ghzawi</h3>
            <p>I am an Electrical Engineer</p>
            <label>I would like to visit</label>
            <ul>
                <li>Norway</li>
                <li>Scotland</li>
                <li>Finland</li>
            </ul>
        </info>
    )
}

export default MyInfo;
